import React from "react";
import Singin from '../../pages/Signin'


function SigninCard(props) {
  return (

    <div className="card">
      <div className="Nav-container">
        <br/>
        <h4>Sign in</h4>
      </div>
      <div className="content">
        <br/>
        <Singin/>
      </div>
    </div>

  );
}

export default SigninCard;
